import React from "react";
import { render } from "react-dom";
import { Parallax } from "react-parallax";
import ParticlesBg from "particles-bg";
import { AwesomeButton } from "react-awesome-button";
import Code from "./components/Code.jsx";
import Icons from "./components/Icons.jsx";

import "react-awesome-button/dist/styles.css";
import "./App.css";

import image1 from "./assets/01.jpeg";
import image2 from "./assets/02.jpeg";
import image3 from "./assets/03.jpeg";
import image4 from "./assets/04.jpeg";
import image5 from "./assets/05.jpeg";

let config = {
  num: [4, 7],
  rps: 0.1,
  radius: [5, 40],
  life: [1.5, 3],
  v: [2, 3],
  tha: [-40, 40],
  // body: "./img/icon.png", // Whether to render pictures
  // rotate: [0, 20],
  alpha: [0.6, 0],
  scale: [1, 0.1],
  position: "center", // all or center or {x:1,y:1,width:100,height:100}
  color: ["random", "#ff0000"],
  cross: "dead", // cross or bround
  random: 15,  // or null,
  g: 5,    // gravity
  // f: [2, -1], // force
  onParticleUpdate: (ctx, particle) => {
      ctx.beginPath();
      ctx.rect(particle.p.x, particle.p.y, particle.radius * 2, particle.radius * 2);
      ctx.fillStyle = particle.color;
      ctx.fill();
      ctx.closePath();
  }
  //  config={config}
};

const App = () => (
  <div className="main">
    <div className="container">
      <Parallax strength={500}>
        <ParticlesBg color="#00ff73" type="cobweb" bg={true}/>
        <div style={{ height: 500 }} className="maxbackground">
          <div className="boxs header">
            <h1 className="title">SoniDEX</h1>
            <h4 className="introduction">
              Exchange by Sonikchain
            </h4>
            <div className="buttons">
              <a href="https://github.com/lindelof/particles-bg">
                <AwesomeButton
                  size="medium"
                  type="secondary"
                >
                  Launch Exchange
                </AwesomeButton> 
              </a> 
              <div className="space"></div>
              <a href="https://github.com/nordicgiant2/gh-pages-theme">
                <AwesomeButton
                  size="medium"
                  type="primary"
                >
                  Documents
                </AwesomeButton>
              </a> 
            </div>
          </div>
        </div>
      </Parallax>

      
    </div>
    <div className="footer">Copyright Mr right. This code is open source.</div>
  </div>
);

export default App;
